import React, {Component} from 'react';
import Node from './Node/Node';
import './algovis.css'

export default class algovis extends Component{
    constructor(props){
        super(props);
        this.state = {nodes:[],};
    }

    componentDidMount(){
        const nodes = [];
        for(let  row= 0; row < 15; row++){
            const currentRow = [];
            for(let col = 0; j < 50; j++){
                const currentNode = {
                    col,
                    row,
                }
                currentRow.push([]);
            }
            nodes.push(currentRow);
        }

        this.setState({nodes});
    }

    render(){
        const {nodes} = this.state;
        console.log(nodes);
        return(
            <div className="grid">
                {nodes.map((row, rowIdx) =>{
                    return <div>
                        {row.map((node, nodeIdx)=><Node></Node>)}
                    </div>
                })}
            </div>
        )
    }
}
